import React from "react";
import BalloonMap from "./BalloonMap";

type Balloon = {
  lat: number;
  lon: number;
  alt: number;
};

type MapProps = {
  rand: number | null;
  allBalloons: boolean;
  balloons: Balloon[];
}

const Map: React.FC<MapProps> = ( {rand, allBalloons, balloons} ) => {
  return (
    <div>
      <BalloonMap balloons={balloons} />
    </div>
  );
};

export default Map;
